import { Accordion, AccordionSummary, AccordionDetails, Typography, makeStyles, withStyles, Grid, TextField, FormControl, FormControlLabel, FormLabel, Radio, RadioGroup } from '@material-ui/core'
import { ExpandMore } from '@material-ui/icons'
import React, { Component } from 'react'
import InsurerOverview from './Components/Insurer/InsurerOverview.web'
import LockIcon from '@material-ui/icons/Lock';
import PropTypes from 'prop-types';
import LabelWithIcon from './Components/LabelWithIcon';
import { Formik } from 'formik';


export const useStyles: any = (theme: any) => ({
    childAccordion: {
        width: '100%',
        '&>div': {
            boxShadow: 'none',
            width: '100%',
            border: '1px solid #ccc',
            //    padding: '15px',
        }
    },
    lineSaprator: {
        margin: '30px 0px',
    }
})

const useStylesFunction = makeStyles({
    accordianHeading: {
        fontWeight: 600,
        display: 'flex',
        alignItems: 'center',
    },
    lockedAccordion: {
        padding: '6px 10px',
        backgroundColor: '#e9f4f9',
        border: '1px solid #ccc',
        borderRadius: '4px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        margin: '0px 8px',
        '& svg': {
            marginRight: '6px',
        }
    }

})

const enumYesNO = {
    YES: 'YES',
    NO: 'NO',
}

type accordionTitleProps = {
    title: string,
    // insuranceData: any,
}

const AccordionTitle = (props: accordionTitleProps) => {
    const classes = useStylesFunction()
    return (
        <Typography className={classes.accordianHeading}>
            {props?.title}
            {/* {
                    <div className={classes.lockedAccordion}>
                        <LockIcon /> Please select insurance type to unlock  this fields
                    </div>
            } */}

        </Typography>
    )
}

type MyState = {
    isEdit: boolean,
    tawuniya: any,
    saudiBank: any,
    axaBank: any,
    release_premium_calculation: string,
    comparison_sheet: string,
    insurance_company_id: string,
};

type MyProps = {
    params: any,
    formType: string,
    changeEdit: () => void,
};

class SalesReview extends Component<MyProps, MyState> {
    static propTypes: { classes: any; };
    constructor(props: any) {
        super(props);
        // console.log(this.props.match.params.id)
        // this.handleStorage = this.handleStorage.bind(this);
        this.state = {
            isEdit: false,
            tawuniya: {
                quotation_recived: '',
                quotation_amount: '',
                comment: '',
                proposal: null,
                additional_attachment: null,
                note_to_the_customer: '',
                release_quotation_to_customer: '',
            },
            saudiBank: {
                quotation_recived: '',
                comment: '',
                additional_attachment: null,
                release_quotation_to_customer: '',
                note_to_the_customer: '',
            },
            axaBank: {
                quotation_recived: '',
                quotation_amount: '',
                comment: '',
                proposal: null,
                additional_attachment: null,
                note_to_the_customer: '',
                release_quotation_to_customer: '',
            },
            release_premium_calculation: '',
            comparison_sheet: '',
            insurance_company_id: '',
        };
    }



    render() {
        const { classes }: any = this.props;
        return (
            <div>
                <Formik
                    enableReinitialize={this.state.isEdit ? true : false}
                    initialValues={{
                        tawuniya: {
                            quotation_recived: '',
                            quotation_amount: '',
                            comment: '',
                            proposal: null,
                            additional_attachment: null,
                            note_to_the_customer: '',
                            release_quotation_to_customer: '',
                        },
                        saudiBank: {
                            quotation_recived: '',
                            comment: '',
                            additional_attachment: null,
                            release_quotation_to_customer: '',
                            note_to_the_customer: '',
                        },
                        axaBank: {
                            quotation_recived: '',
                            quotation_amount: '',
                            comment: '',
                            proposal: null,
                            additional_attachment: null,
                            note_to_the_customer: '',
                            release_quotation_to_customer: '',
                        },
                        release_premium_calculation: '',
                        comparison_sheet: '',
                        insurance_company_id: '',
                    }}
                    // validationSchema={Yup.object().shape(CustomerFormSchema(this.state.isArabicLenguage))}
                    // validateOnMount={true}
                    validateOnBlur={true}
                    onSubmit={async (values, actions) => {
                        console.log("formik data :", values)
                        // if (this.state.isEdit) {
                        //     this.editCustomer(values);
                        // } else {
                        //     this.submitCustomerForm(values);
                        // }
                    }}
                >
                    {({
                        handleSubmit,
                        errors,
                        touched,
                        values,
                        setFieldValue,
                        validateForm
                    }) => (
                        <Accordion>
                            <AccordionSummary
                                aria-expanded={true}
                                expandIcon={<ExpandMore />}
                                aria-controls="Insurers"
                                id="Insurers"
                            >
                                <AccordionTitle title='Releasing to customer' />
                            </AccordionSummary>
                            <AccordionDetails>
                                {/* <CustomDataTable
                                    onClick={() => { console.log("sadbhj") }}
                                /> */}

                                <div className={classes.childAccordion}>
                                    <Accordion>
                                        <AccordionSummary
                                            aria-expanded={true}
                                            expandIcon={<ExpandMore />}
                                            aria-controls="Insurers"
                                            id="Insurers"
                                        >
                                            <AccordionTitle title='Tawuniya' />
                                        </AccordionSummary>
                                        <AccordionDetails style={{ width: '100%' }}>
                                            {/* <CustomDataTable
                                    onClick={() => { console.log("sadbhj") }}
                                /> */}

                                            <div style={{ width: '100%' }}>
                                                <Grid container spacing={3}>
                                                    <Grid item xs={12} sm={4}>
                                                        <FormControl>
                                                            <LabelWithIcon label={'Quotation received?'} />
                                                            <RadioGroup
                                                                row
                                                                aria-labelledby="demo-row-radio-buttons-group-label"
                                                                name="row-radio-buttons-group"
                                                            >
                                                                <FormControlLabel value="YES" control={<Radio />} label="Yes" />
                                                                <FormControlLabel value="NO" control={<Radio />} label="No" />
                                                            </RadioGroup>
                                                        </FormControl>
                                                    </Grid>
                                                    <Grid item xs={12} sm={4}>
                                                        <LabelWithIcon label={'Quotation amount'} />
                                                        <TextField
                                                            id="outlined-basic"
                                                            label=""
                                                            variant="outlined"
                                                            fullWidth
                                                            name='Quotation_amount'
                                                            value='C-000001'
                                                        // onChange={formik.handleChange}
                                                        />
                                                    </Grid>
                                                    <Grid item xs={12} sm={4}>
                                                        <LabelWithIcon label={'Proposal'} />
                                                        <TextField
                                                            id="outlined-basic"
                                                            label=""
                                                            variant="outlined"
                                                            name='Proposal'
                                                            fullWidth
                                                            value='C-000001'
                                                        // onChange={formik.handleChange}
                                                        />
                                                    </Grid>
                                                </Grid>

